import axios from "axios"
import notesImg from "../../images/notes1.png"
import { useFormik } from 'formik'
import React, { useState } from 'react'
import { Link, Navigate, useNavigate } from 'react-router-dom'
import * as Yup from "yup"

export default function Register() {
  
    let navigate = useNavigate()
    const [registerError , setRegisterError] = useState("")
    async function Register(values)
    {
        try
        {
            let {data} = await axios.post("https://note-sigma-black.vercel.app/api/v1/users/signUp",values)
            console.log(data)
            // navigate to login page

            navigate("/login")
        }
        catch(error){
            console.log(error.response.data.msg)
            setRegisterError(error.response.data.msg)
        }
        
    }
  
  
    const validation = Yup.object({
        name: Yup.string().required("name is required").min(3,"name min length is 3").max(15,"name max length is 15"),
        email:Yup.string().email("please enter a valid email").required("email is required"),
        password:Yup.string().required("password is required").matches(/^(?=.*[A-Za-z])(?=.*\d)[A-Za-z\d]{6,}$/,"Minimum six characters, at least one letter and one number"),
        age: Yup.number().required("age is required").min(10,"min age is 10").max(100 , "max age is 100"),
        phone: Yup.string().required("phone number is required").matches(/^01[0125][0-9]{8}$/,"enter a valid phone number")
    })
    const formik = useFormik({
    initialValues:
    {
        name:'',
        email:'',
        password:'',
        age:'',
        phone:''
    },
    validationSchema:validation,
    onSubmit:Register

  })
  
    return (
    
        <>
        <li className="fixed-top p-3 pe-lg-5 d-lg-flex d-none  ">
            <i className="fa-regular fa-note-sticky text-info fs-2"></i>                           
            <p className='ps-2 fs-4 fw-bold'>Notes</p>
        </li>
        <div className="container">
          <div className="row">
            <div className="col-lg-5 d-none d-lg-flex justify-content-center align-items-center">
              <img className='w-100 p-5' src={notesImg}  alt="" />
            </div>
           
           
            <div className="col-lg-7">
            <div className='min-vh-100 d-flex justify-content-center align-items-center text-center signup-container'>
            <div className='bg-light bg-opacity-25 shadow w-100 mx-auto  p-5 rounded-2'>
                <h1 className='fw-bold'>Sign Up Now</h1>
                <div className='pt-3'>
                {registerError? <p className="alert alert-danger">{registerError}</p>: null}
                <form onSubmit={formik.handleSubmit}>

                  <input onBlur={formik.handleBlur} onChange={formik.handleChange}  className='form-control my-2' type="text" name='name' id='name' placeholder='Enter Your Name' />
                  {formik.errors.name && formik.touched.name ?<p className="text-danger fs-small text-start ps-2">{formik.errors.name}</p>:null}
                  <input onBlur={formik.handleBlur} onChange={formik.handleChange}  className='form-control my-2' type="email" name='email' id='email' placeholder='Enter Your Email' />
                  {formik.errors.email && formik.touched.email ?<p className="text-danger fs-small text-start ps-2">{formik.errors.email}</p>:null}
                  <input onBlur={formik.handleBlur} onChange={formik.handleChange}  className='form-control my-2' type="password" name='password' id='password' placeholder='Enter Your Password' />
                  {formik.errors.password && formik.touched.password ?<p className="text-danger fs-small text-start ps-2">{formik.errors.password}</p>:null}
                  <input onBlur={formik.handleBlur} onChange={formik.handleChange}  className='form-control my-2' type="number" name='age' id='age' placeholder='Enter Your Age' />
                  {formik.errors.age && formik.touched.age ?<p className="text-danger fs-small text-start ps-2">{formik.errors.age}</p>:null}
                  <input onBlur={formik.handleBlur} onChange={formik.handleChange}  className='form-control my-2' type="text" name='phone' id='phone' placeholder='Enter Your Phone Number' />
                  {formik.errors.phone && formik.touched.phone ?<p className="text-danger fs-small text-start ps-2">{formik.errors.phone}</p>:null}
                  <button type='submit' className='btn btn-info text-light w-100 rounded-2 mt-2'> Sign Up</button>
                  {/* <p className='pt-2'>Already have account</p> <Link className='text-decoration-none' to='/login'>Login Now</Link> */}
                </form>
                </div>
            </div>
        </div>
            </div>
          </div>
        </div>
    
        </>
  )
}
